import moment from 'moment'

class TodoComponent extends Component {

    constructor(props){
        super(props)
        this.state = {
            id : this.props.params.id,
            description : 'some',
            targetDate : moment(new Date()).format('YYYY-MM-DD')
        }
    }
    render() {
        return <div>
                <h1>Todo</h1>
                <div className='container'>
                    <Formik>
                        {
                            (props) => (
                                <div></div>
                            )
                        }
                    </Formik>
                </div>
            </div>

    }
}

export default TodoComponent
